import React, { Suspense, lazy } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.js";
import TopMenu from "./components/TopMenu";
import Header from "./components/Header";
import Footer from "./App.min.css";
import ProductList from "./views/ProductList";
import ProductDetail from "./views/ProductDetail";
import Privacy from "./views/Privacy";
import data from "./views/data";

import ReturnPolicy from "./views/ReturnPolicy";
import TermUse from "./views/TermUse";
import SearchResult from "./views/SearchResult";
import { Security } from "./views/Security";
import EPRCompliance from "./views/EPRCompliance";
import { PaymentSuccessful } from "./views/cart/PaymentSuccessful";
import { ShoppingCartProvider } from "./views/cart/ShoppingCartContext";

const HomeView = lazy(() => import("./views/Home"));
const CartView = lazy(() => import("./views/cart/Cart"));
const CheckoutView = lazy(() => import("./views/cart/Checkout"));
const NotFoundView = lazy(() => import("./views/pages/404"));
const InternalServerErrorView = lazy(() => import("./views/pages/500"));
const SupportView = lazy(() => import("./views/pages/Support"));

const products = data.products;

const App = () => {
    return (
        <ShoppingCartProvider>
            <BrowserRouter>
                <Header allproducts={products} />
                <TopMenu />
                <Suspense fallback={<div className="text-white text-center mt-3">Loading...</div>}>
                    <Routes>
                        <Route path="" element={<ProductList allproducts={products} />} />
                        <Route path="category/:cat" element={<ProductList allproducts={products} />} />
                        <Route path="product/detail/:id" element={<ProductDetail allproducts={products} />} />
                        <Route path="cart" element={<CartView />} />
                        <Route path="checkout" element={<CheckoutView />} />
                        <Route path="support" element={<SupportView />} />
                        <Route path="return" element={<ReturnPolicy />} />
                        <Route path="privacy" element={<Privacy />} />
                        <Route path="term" element={<TermUse />} />
                        <Route path="security" element={<Security />} />
                        <Route path="epr" element={<EPRCompliance />} />
                        <Route path="500" element={<InternalServerErrorView />} />
                        <Route path="checkout/success" element={<PaymentSuccessful />} />
                        <Route path="searchResult" element={<SearchResult allproducts={products} />} />
                        <Route element={<NotFoundView />} />
                    </Routes>
                </Suspense>
                <Footer allproducts={products} />
            </BrowserRouter>
        </ShoppingCartProvider>
    );
}

export default App;
